import Dialog from "@mui/material/Dialog";
import { MdClose, MdAdd, MdRemove, MdArrowBack, MdArrowForward, MdFavoriteBorder, MdCompareArrows } from "react-icons/md";
import Button from "@mui/material/Button";
import Rating from "@mui/material/Rating";
import { useState } from "react";
import { TransformWrapper, TransformComponent } from "react-zoom-pan-pinch";

const ProductModel = ({ open, onClose }) => {
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const [quantity, setQuantity] = useState(1);

  const images = [
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTaOHQO8lRGJplChV3u8BcTKba1pxFiVeBfIg&s",
    "https://mma.prnewswire.com/media/2477644/Lay_s_Global_Flavors_Trio__1.jpg?p=facebook",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-5H_jzz7Z3zuvqeewwqwD8GiqKFW5A-Jnhg&s"
  ];

  const handleNext = () => setCurrentImageIndex((prevIndex) => (prevIndex + 1) % images.length);
  const handlePrev = () => setCurrentImageIndex((prevIndex) => (prevIndex - 1 + images.length) % images.length);
  const increaseQuantity = () => setQuantity(prevQuantity => prevQuantity + 1);
  const decreaseQuantity = () => setQuantity(prevQuantity => prevQuantity > 1 ? prevQuantity - 1 : 1);

  return (
    <Dialog open={open} onClose={onClose} maxWidth="md" fullWidth>
      <div className="modal-content p-4">
        <Button className="close_ position-absolute top-0 end-0 m-2" onClick={onClose}>
          <MdClose />
        </Button>
        <h2>Product Details</h2>
        <div className="d-flex align-items-center">
          <span>Brand: Welch's</span>
          <Rating name="read-only" value={5} size="small" precision={0.5} readOnly />
        </div>
        <hr />
        <div className="row mt-2 ProductDetailModal">
          <div className="col-md-5">
            <TransformWrapper initialScale={1} minScale={0.5} maxScale={3} wheel={{ step: 0.1 }}>
              {({ zoomIn, zoomOut }) => (
                <>
                  <div className="zoom-controls d-flex justify-content-center">
                    <Button onClick={zoomIn} variant="outlined" size="small">Zoom In</Button>
                    <Button onClick={zoomOut} variant="outlined" size="small" className="ms-2">Zoom Out</Button>
                  </div>
                  <TransformComponent>
                    <img src={images[currentImageIndex]} alt="Product" style={{ maxHeight: "300px", objectFit: "contain" }} />
                  </TransformComponent>
                </>
              )}
            </TransformWrapper>
            <div className="navigation-controls d-flex justify-content-between mt-3">
              <Button onClick={handlePrev} variant="contained" color="primary"><MdArrowBack /></Button>
              <Button onClick={handleNext} variant="contained" color="primary"><MdArrowForward /></Button>
            </div>
          </div>
          <div className="col-md-7">
            <h3>Product Name</h3>
            <p className="text-muted">Product description goes here.</p>
            <h4>Price: $29.99</h4>
            <div className="d-flex align-items-center mt-3">
              <div className="quantity-control d-flex align-items-center border rounded me-3">
                <Button onClick={decreaseQuantity} variant="text" size="small"><MdRemove /></Button>
                <span className="mx-3">{quantity}</span>
                <Button onClick={increaseQuantity} variant="text" size="small"><MdAdd /></Button>
              </div>
              <Button variant="contained" color="primary">Add to Cart</Button>
            </div>
            <div className="additional-actions d-flex mt-3">
              <Button variant="outlined" startIcon={<MdFavoriteBorder />} className="me-2" size="small">Wishlist</Button>
              <Button variant="outlined" startIcon={<MdCompareArrows />} size="small">Compare</Button>
            </div>
          </div>
        </div>
      </div>
    </Dialog>
  );
};

export default ProductModel;
